import React from 'react'

//import {FaAngleLeft} from "react-icons/fa";
//import {FaAngleRight} from "react-icons/fa";

const Heromain = () => {
    const slidefunc1 = () =>{
        document.querySelector(".slider").style.marginLeft = "0%";
        document.querySelector(".slider").style.transition = "all 1.5s";
      };
    const slidefunc2 = () =>{
        document.querySelector(".slider").style.marginLeft = "-100%";
        document.querySelector(".slider").style.transition = "all 1.5s";
      };
      const slidefunc3 = () =>{
        document.querySelector(".slider").style.marginLeft = "-200%";
        document.querySelector(".slider").style.transition = "all 1.5s";
      };
  return (
    <div>
        <div className="slider">
        <div className="slideImg">
                <img src="https://iutaa.com/static/media/iutaa.banner.4f524892.jpg" alt="a"></img>
            </div>
            <div className="slideImg">
                <img src="https://prod-media-eng.dhakatribune.com/uploads/2020/01/iutaa-reunion-2020-1578579421409.jpg" alt="b"/>
            </div>
            <div className="slideImg">
                <img src="https://i.ytimg.com/vi/Xhu__BTxy0A/maxresdefault.jpg" alt="b" />
            </div>
        </div>
        <div className="slideimgbut" data-aos="fade-left">
            <button onClick={() => slidefunc1()}><img src="https://iutaa.com/static/media/iutaa.banner.4f524892.jpg" alt="b"></img></button>
            <button onClick={() => slidefunc2()}><img src="https://prod-media-eng.dhakatribune.com/uploads/2020/01/iutaa-reunion-2020-1578579421409.jpg" alt="b"></img></button>
            <button onClick={() => slidefunc3()}><img src="https://i.ytimg.com/vi/Xhu__BTxy0A/maxresdefault.jpg" alt="b"></img></button>
        </div>
        <div className="herodesc" data-aos="fade-right">
          <p>Discover our place</p>
          <h1 className="herodescbld herodescc" className="herodescc">Explore The </h1>
          <h2 className="herodescbld herodescc" className="">Best</h2><h2 className="herodescc"> Beautiful </h2>
          <h1  className="herodescbld">Campus</h1>
          <button>Explore</button>
        </div>
    </div>
  )
}

export default Heromain
